import React, { Component } from 'react';


class Banner extends Component {
    constructor(){
        super()
        this.state ={
            username: "",
            password: ""
        }
        this.usernameChange = this.bind(this)
        this.passwordChange = this.bind(this)
    }
    usernameChange(event){
        this.setState({
            username : event.target.value
        })
    }
    passwordChange(event){
        this.setState({
            password : event.target.value
        })
    }
    render() { 
        return ( 
            <div>
                <label>Username</label>
                <input name="username" type="email" value={this.state.username} onChange={this.usernameChange}/>
                <label>Password</label>
                <input name="password" type="password" value={this.state.password} onChange={this.passwordChange} />
            </div>
         );
    }
}
 
export default Banner;
